import { render } from '@testing-library/react'
import Nav from '../nav/nav'
import React from 'react'

class Cart extends React.Component {
  render() {
    const { cartList } = this.context
    return (
      <div>
        <Nav />
        <div>
          <div>
            <h2>Cart</h2>
          </div>
          <div></div>
        </div>
      </div>
    )
  }
}

export default Cart
